textOriginal:
@츄르츄릅 그렇게 하려면 피격점 체력을 다 나눠서 타르코프처럼 계산하는수밖에 없음
그리고 9미리 파라블럼같은 권총탄 맞았다고(머리는 맞으면 당연히 죽으니까 제외하자)
 맨날 마약성 진통제에 카페인음료 몇캔 몇병씩 먹는 약쟁이들이 빈사상태에 빠질리는 없지 않나?

